export default () => {
  return (
    <div>
      <div className='bg-earth bg-no-repeat bg-fixed min-h-screen flex justify-center items-center'>
        <div className='box relative bg-black bg-opacity-75 rounded-lg p-12 max-w-lg'>
          <img className='object-contain float-left w-24 mr-4 my-2' src='/assets/static/iam.jpg' alt='' />
          <p className='box-text'>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Quo facere vero consequatur sunt eum commodi voluptate ducimus ex accusamus! Possimus rerum ullam eum soluta, ea eligendi enim accusamus eius esse!Expedita ipsum libero temporibus, sunt ratione fuga doloribus, optio error a molestiae minus excepturi nam soluta veniam, rem distinctio tempora commodi quam? Nemo recusandae est odit? Facere mollitia ipsa modi.</p>
        </div>
      </div>
      <style jsx>{`
        .bg-earth::before {
          content: "";
          position: absolute;
          top: 0;
          left: 0;
          width: 100%; height: 100%;
          background-image: url("/assets/static/earth.jpg");
          filter: hue-rotate(135deg) sepia(40%);
        }
        .box {
          box-shadow: 0 0 5px #fff,0 0 10px #fff,0 0 15px #fff,0 0 20px #076eb3,0 0 25px #076eb3;
        }
        .box-text {
          text-shadow: 0 0 5px #ffffff, 0 0 10px #076eb3, 0 0 15px #076eb3;
          /*box-shadow: 0 0 5px #fff,0 0 10px #fff,0 0 15px #fff,0 0 20px #076eb3,0 0 25px #076eb3;*/
        }
      `}</style>
    </div>
  )
}
